import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Chip,
  IconButton,
  Tooltip,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
  Visibility as ViewIcon,
} from '@mui/icons-material';
import axios from 'axios';

const Claims = () => {
  const [claims, setClaims] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedClaim, setSelectedClaim] = useState(null);
  const [formData, setFormData] = useState({
    policyId: '',
    description: '',
    amount: '',
    documents: [],
  });

  useEffect(() => {
    fetchClaims();
  }, []);

  const fetchClaims = async () => {
    try {
      setLoading(true);
      // В реальном приложении здесь был бы запрос к API
      const mockClaims = [
        {
          id: 1,
          policyNumber: 'POL-001',
          description: 'Car accident damage',
          amount: 5000,
          status: 'pending',
          date: '2024-03-15',
        },
        {
          id: 2,
          policyNumber: 'POL-002',
          description: 'Home flood damage',
          amount: 15000,
          status: 'approved',
          date: '2024-03-10',
        },
      ];
      setClaims(mockClaims);
    } catch (err) {
      setError('Failed to fetch claims');
    } finally {
      setLoading(false);
    }
  };

  const handleOpenDialog = (claim = null) => {
    if (claim) {
      setSelectedClaim(claim);
      setFormData({
        policyId: claim.policyNumber,
        description: claim.description,
        amount: claim.amount,
        documents: [],
      });
    } else {
      setSelectedClaim(null);
      setFormData({
        policyId: '',
        description: '',
        amount: '',
        documents: [],
      });
    }
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedClaim(null);
    setFormData({
      policyId: '',
      description: '',
      amount: '',
      documents: [],
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (selectedClaim) {
        // Обновление существующей претензии
        await axios.put(`/api/claims/${selectedClaim.id}`, formData);
      } else {
        // Создание новой претензии
        await axios.post('/api/claims', formData);
      }
      handleCloseDialog();
      fetchClaims();
    } catch (err) {
      setError('Failed to save claim');
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this claim?')) {
      try {
        await axios.delete(`/api/claims/${id}`);
        fetchClaims();
      } catch (err) {
        setError('Failed to delete claim');
      }
    }
  };

  const getStatusColor = (status) => {
    switch (status.toLowerCase()) {
      case 'approved':
        return 'success';
      case 'pending':
        return 'warning';
      case 'rejected':
        return 'error';
      default:
        return 'default';
    }
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">Insurance Claims</Typography>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={() => handleOpenDialog()}
        >
          New Claim
        </Button>
      </Box>

      {error && (
        <Typography color="error" sx={{ mb: 2 }}>
          {error}
        </Typography>
      )}

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Policy Number</TableCell>
              <TableCell>Description</TableCell>
              <TableCell>Amount</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Date</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {claims.map((claim) => (
              <TableRow key={claim.id}>
                <TableCell>{claim.policyNumber}</TableCell>
                <TableCell>{claim.description}</TableCell>
                <TableCell>${claim.amount}</TableCell>
                <TableCell>
                  <Chip
                    label={claim.status}
                    color={getStatusColor(claim.status)}
                    size="small"
                  />
                </TableCell>
                <TableCell>{claim.date}</TableCell>
                <TableCell>
                  <Tooltip title="View Details">
                    <IconButton
                      size="small"
                      onClick={() => handleOpenDialog(claim)}
                    >
                      <ViewIcon />
                    </IconButton>
                  </Tooltip>
                  <Tooltip title="Edit">
                    <IconButton
                      size="small"
                      onClick={() => handleOpenDialog(claim)}
                    >
                      <EditIcon />
                    </IconButton>
                  </Tooltip>
                  <Tooltip title="Delete">
                    <IconButton
                      size="small"
                      onClick={() => handleDelete(claim.id)}
                    >
                      <DeleteIcon />
                    </IconButton>
                  </Tooltip>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="sm" fullWidth>
        <DialogTitle>
          {selectedClaim ? 'Edit Claim' : 'New Claim'}
        </DialogTitle>
        <DialogContent>
          <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
            <TextField
              fullWidth
              label="Policy Number"
              value={formData.policyId}
              onChange={(e) =>
                setFormData({ ...formData, policyId: e.target.value })
              }
              margin="normal"
              required
            />
            <TextField
              fullWidth
              label="Description"
              value={formData.description}
              onChange={(e) =>
                setFormData({ ...formData, description: e.target.value })
              }
              margin="normal"
              required
              multiline
              rows={4}
            />
            <TextField
              fullWidth
              label="Amount"
              type="number"
              value={formData.amount}
              onChange={(e) =>
                setFormData({ ...formData, amount: e.target.value })
              }
              margin="normal"
              required
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained">
            {selectedClaim ? 'Update' : 'Submit'}
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Claims;
